%[text] # Dice Rolling
% Number of dice rolls
numRolls = 1000;

% Simulate rolling a dice
diceRolls = randi([1, 6], numRolls, 1);

% Create a histogram of the dice rolls
figure; %[output:6fdd9037]
histogram(diceRolls, 'Normalization', 'probability', 'BinMethod', 'integers'); %[output:6fdd9037]
xlabel('Dice Value'); %[output:6fdd9037]
ylabel('Probability'); %[output:6fdd9037]
title('Histogram of Dice Rolls (1000 Rolls)'); %[output:6fdd9037]
xlim([0.5 6.5]); %[output:6fdd9037]
xticks(1:6); %[output:6fdd9037]
grid on; %[output:6fdd9037]

